text:
@zoomstreetart, посмотрел сегодня в натуре -- это грандиозно и очень многослойно. Девочка Таня из Волоколамска тоже ведь имелась в виду? 
Кстати, в соседний дом, №17 прилетала на метле Маргарита громить квартиру критика Латунского.
А еще - сценарий к фильму ДПилиПВВ писал Александр Галич, которого из титров вымарали после эмиграции.
